import 'package:ieca_mobile/enums/hymns_content_code.dart';
import 'package:ieca_mobile/models/_import.dart';
import 'package:ieca_mobile/seeders/_import.dart';

class UmHymnsOmala {
  static List<HymnsContent> list =[
    HymnsContent(id: 2130, position: 1, content: "Etali tueya, tua sanjuka,\nEtu tumãla va’e.\nTu lupukila kosikola,\nEtu tumãla va’e.", hymnsNumber: UmHymnsNumberSeeder.OMALA_126, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2131, content: "Momo Yesu o popela omala va’e,\nOmala va’e, Omala va’e.\nMomo Yesu o popela omala va’e,\nAkuetu, Tu lingi va’e.", hymnsNumber: UmHymnsNumberSeeder.OMALA_126, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2132, position: 2, content: "Akandu etu tua suvuka;\nEtu tumãla va’e.\nKupika wao tu ilukako,\nEtu tumãla va’e.", hymnsNumber: UmHymnsNumberSeeder.OMALA_126, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2133, position: 3, content: "Ondaka ya’e tua yi limbuka;\nEtu tumãla va’e.\nItima vietu via petuka,\nEtu tumãla va’e.", hymnsNumber: UmHymnsNumberSeeder.OMALA_126, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2134, position: 1, content: "Enjui ku Yesu, ko ka lendi,\nLondaka yaye wa lalekiwi.\nPokati ketu hapo a kasi,\nWa linga hati, enjui.", hymnsNumber: UmHymnsNumberSeeder.OMALA_127, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2135, content: "Lonjolela tu liongolola,\nOvitima eci vi lipua.\nKumue la Yesu tu tumala,\nWa linga hati, enjui.", hymnsNumber: UmHymnsNumberSeeder.OMALA_127, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2136, position: 2, content: "Ndaño omãla, va lalekua;\nItima viosi vi yolele;\nTu noli u wa tu yongola;\nWa linga hati, enjui.", hymnsNumber: UmHymnsNumberSeeder.OMALA_127, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2137, position: 3, content: "Etali o kasi kumue letu;\nKokeli vosi lepokolo.\nHo yevelela ondaka ya’e,\nWa linga hati, enjui.", hymnsNumber: UmHymnsNumberSeeder.OMALA_127, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2138, position: 1, content: "Evi viosi via posoka\nVi li kulo kilu lieve.\nOlomunda, okalunga,\nOlombungululu vilu,\nViosi vi tu situluila\nOcisola ca Isietu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_128, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2139, position: 2, content: "Nda kutanya, nda kuteke,\nTu limboka ohenda yaye.\nOku tata kuolonjali,\nOcisola cavakuetu\nViosi vi tu situluila\nOcisola ca Isietu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_128, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2140, position: 3, content: "Osi yiwa yoku lima,\nOvikula vi tu tekola.\nOnembele yefendelo,\nOsikola yovipama.\nViosi vi tu situluila\nOcisola ca Isietu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_128, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2141, position: 4, content: "Uhayele wovatimba,\nOlondunge viovitima,\nIsimilo viosi viwa,\nElavoko liepopelo.\nViosi vi tu situluila\nOcisola ca Isietu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_128, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2142, position: 1, content: "Ñala Yesu wa njogola\nOku u taimila,\nKosikola kuenda kimbo\nOku u sanjuisa.", hymnsNumber: UmHymnsNumberSeeder.OMALA_129, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2143, content: "Ocinyi, ocinyi,\nYesu hati, Ka naimile.\nOcinyi, ocinyi,\nNdinga ocinyi ca'e.", hymnsNumber: UmHymnsNumberSeeder.OMALA_129, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2144, position: 2, content: "Hati, kala locisola\nLohenda la vosi,\nOco o va lekisa ndomo\nWa sanjuka ocili.", hymnsNumber: UmHymnsNumberSeeder.OMALA_129, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2145, position: 3, content: "Ndomba ku Yesu a ñuatise\nOku tila akandu,\nNdombolola ohenda yahe,\nLoku u taimila.", hymnsNumber: UmHymnsNumberSeeder.OMALA_129, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2146, position: 4, content: "Ndinga ocinyi ca Yesu,\nOco ndi livela;\nNdu vumba eteke keteke,\nKilu ha kala la'e.", hymnsNumber: UmHymnsNumberSeeder.OMALA_129, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2147, position: 1, content: "Kofeka yava va yowiwa\nKu li omãla va lua.\nItima viavo via yelisua.\nVa li oku imba lonjolela,\nVati, Ulamba;\nUlamba konjovoli yetu!", hymnsNumber: UmHymnsNumberSeeder.OMALA_130, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2148, position: 2, content: "Va mola ndati ulamba waco?\nVa iñila ndati?\nCa pita ndati okuti omãla\nVa li oku imba lonjolela,\nVati, Ulamba;\nUlamba konjovoli yetu!", hymnsNumber: UmHymnsNumberSeeder.OMALA_130, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2149, position: 3, content: "Va kolelele kilu lieve\nYesu ukuahenda.\nVa solelevo onduko yaye\nOco cilo va li oku imba,\nVati, Ulamba;\nUlamba konjovoli yetu!", hymnsNumber: UmHymnsNumberSeeder.OMALA_130, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2150, position: 4, content: "Letuvo vosi nda tu tava\nKonjovoli yavo.\nTu sanjukila kumue lavo\nTu ka tumbangiya Yesu,\nTuti, Ulamba;\nUlamba konjovoli yetu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_130, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2151, position: 1, content: "Ku li ekamba liotumãla\nLi kasi kovailu.\nEkamba liaco Yesu.\nEye ukuahenda.\nAkamba vamue vaño;\nVa pongoloaka ño.\nYesu eye wa velapo.\nKa pongoloka mbu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_131, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2152, position: 2, content: "Ku li olonjo viotumãla\nVi kasi kovailu.\nOko tu ka tumãla\nKulamba wa Suku.\nKulo koluali kuwa,\nPuãi kilu kua piãla.\nKa ku li olomumbe\nKofeka ya Yesu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_131, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2153, position: 3, content: "Ku li isungo viotumãla\nVi kasi kovailu.\nVa ka sivaya lavio\nOsoma yulamba.\nVa kala lonjolela\nOtembo yenda hu.\nHa tu endi atumãla;\nTu lungi ku Yesu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_131, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2154, position: 1, content: "Eci Ñala Yesu eya\nHa sandi ukuasi,\nO yongola otumãla\nNdukuasi waye.", hymnsNumber: UmHymnsNumberSeeder.OMALA_132, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2155, content: "Kekolowa lia Yesu,\nNdolombungululu.\nOtumala tu nina;\nUlamba waye.", hymnsNumber: UmHymnsNumberSeeder.OMALA_132, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2156, position: 2, content: "O yongola, o yongola\nOmãla vocili.\nNoke enda lavo kilu;\nUlamba waye.", hymnsNumber: UmHymnsNumberSeeder.OMALA_132, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2157, position: 3, content: "Ñala Yesu o li kumue\nLotumãla tuaye.\nTuo yelela kovitima;\nUkuasi waye.", hymnsNumber: UmHymnsNumberSeeder.OMALA_132, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2158, position: 1, content: "Akai va nena\nOmãla konjovoli.\nOlondonge via simile\nOku va tateka.\nYesu eci a ci mola\nWa lemela olondonge,\nHati, Otumãla\nTuiye kokuange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_133, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2159, position: 2, content: "Omãla va sanga\nEkamba lia velapo.\nHati, ko ka va tateki,\nVeye ño kokuange.\nWa va vanja locisola\nWa va sumuluisa vosi,\nHati, Otumãla\nTuiye kokuange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_133, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2160, position: 3, content: "Ohenda ya Yesu\nYa piãla ovina viosi.\nVa lua puãi ka va la yeva\nEsapulo liaye.\nKa va kasi lonjolela\nNdetu tuakuandaka yiwa,\nYiti, Otumãla\nTuiye kokuange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_133, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2161, position: 4, content: "Tuakuaku livela\nNda olofeka viosi\nVi kuliha Ñala Yesu\nOnjovoli yetu,\nOco vi pue owelema\nLoku sanjukila ondaka,\nYiti, Otumãla\nTuiye kokuange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_133, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2162, position: 1, content: "Yesu o sole, ocili,\nYeveleli ondaka yahe;\nOmanu vosi va tava,\nHati o va popela.", hymnsNumber: UmHymnsNumberSeeder.OMALA_134, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2163, content: "Yesu o sole,\nYesu o sole,\nYesu o sole,\nO sole ocili.", hymnsNumber: UmHymnsNumberSeeder.OMALA_134, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2164, position: 2, content: "Yesu o sole; wa fila,\nKakandu wa njovola;\nWa muisa onjila yokilu;\nO ngendisa lesanju.", hymnsNumber: UmHymnsNumberSeeder.OMALA_134, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2165, position: 3, content: "Yesu o sole muele hu,\nAme ocisola sio;\nKomangu yahe o tumala,\nNdimõlahe o ndava.", hymnsNumber: UmHymnsNumberSeeder.OMALA_134, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2166, position: 4, content: "Yesu o sole ocili,\nO natanata ka kavi mbu;\nNda ndu sola eteke fa,\nO nyiñisa kulamba.", hymnsNumber: UmHymnsNumberSeeder.OMALA_134, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2167, position: 1, content: "Soli Suku, ene atumãla,\nEye ocisola.\nSoli Suku, ene atumãla,\nEye ocisola.", hymnsNumber: UmHymnsNumberSeeder.OMALA_135, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2168, position: 2, content: "U pandiyi, ene atumãla,\nEye ocisola.\nU pandiyi, ene atumãla,\nEye ocisola.", hymnsNumber: UmHymnsNumberSeeder.OMALA_135, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2169, position: 3, content: "U panduli, ene atumãla,\nEye ocisola.\nU panduli, ene atumãla,\nEye ocisola.", hymnsNumber: UmHymnsNumberSeeder.OMALA_135, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2170, position: 4, content: "U koleli, ene atumãla,\nEye ocisola.\nU koleli, ene atumãla,\nEye ocisola.", hymnsNumber: UmHymnsNumberSeeder.OMALA_135, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2171, position: 5, content: "U sumbili, ene atumãla,\nEye ocisola.\nU sumbili, ene atumãla,\nEye ocisola.", hymnsNumber: UmHymnsNumberSeeder.OMALA_135, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2172, position: 6, content: "Vumbi Suku, ene atumãla,\nEye ocisola.\nU vialeki vovitima viene.\nEye ocisola.", hymnsNumber: UmHymnsNumberSeeder.OMALA_135, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2173, position: 1, content: "Muli asapulo a fina,\nVembimbiliya li kola.\nA lombolola esunga liomanu,\nVa vumba Yehova Suku", hymnsNumber: UmHymnsNumberSeeder.OMALA_136, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2174, position: 2, content: "Tu tanga ndomo Yosefe,\nVo landisile kupika.\nPuãi eci a linga onganji yinene,\nWa ecela vakuaviñali.", hymnsNumber: UmHymnsNumberSeeder.OMALA_136, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2175, position: 3, content: "Tu sole ondaka ya Mose,\nOñaña ya wundisilue.\nNoke eci a kula wa linga usongui,\nWomãla va Isaleli.", hymnsNumber: UmHymnsNumberSeeder.OMALA_136, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2176, position: 4, content: "Ndaviti ungombo wocili,\nWa sola olomeme viaye.\nNoke eci a linga osoma yinene,\nWa viala lutoi lesunga.", hymnsNumber: UmHymnsNumberSeeder.OMALA_136, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2177, position: 5, content: "Puãi muli ondaka ya piãla,\nOyo tu yi sole enene.\nYa Yesu wa sumuluisa omãla;\nWa linga ekamba lietu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_136, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2178, position: 1, content: "Yesu hati, Taimi ndolovela,\nVolohondo viene, nda mu tekava.\nKulo kilu lieve vosi tu taimi;\nOve ovela yove, lame yange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_137, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2179, position: 2, content: "Yesu hati, Taimi. Ondaka Ya’e\nOyo ulela waco eye a tu avela.\nTulovela viaye. Tu taimi ciwa;\nOve ovela yove, lame yange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_137, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2180, position: 3, content: "Yesu hati, Tuili vowelema,\nKuli upeke wa lua, una wutima.\nVa lua va nyelela. Tu ka va tuila;\nOve ovela yove, lame yange.", hymnsNumber: UmHymnsNumberSeeder.OMALA_137, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2181, position: 1, content: "Yesu o songuila, ca fina!\nOndaka yelembeleko.\nNdaño vekango lionjembo\nLeka liahe osonguila.", hymnsNumber: UmHymnsNumberSeeder.OMALA_138, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2182, content: "Osonguila, osonguila,\nLeka liahe osonguila.\nNdu kokuama ocituke\nMomo osonguila ocili.", hymnsNumber: UmHymnsNumberSeeder.OMALA_138, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2183, position: 2, content: "Pamue kotembo yesumuo,\nPamue kotembo yayonjo,\nNdaño okalunga katema,\nOsonguila leka liahe.", hymnsNumber: UmHymnsNumberSeeder.OMALA_138, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2184, position: 3, content: "Ndi kuata ño eka Liahe,\nSi ka lisiõsiõla vali;\nKovina viosi njolela,\nOmo Yehova osonguila.", hymnsNumber: UmHymnsNumberSeeder.OMALA_138, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2185, position: 4, content: "Eci ha tula omuenyo\nUpange nda malusula,\nKokuove oko salama,\nLove ha tumala ño hu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_138, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2186, position: 1, content: "Ka yeve ondaka yungombo\nOve ukamõla ka Yesu,\nTava etali, iñila,\nVocunda cahe cohenda.", hymnsNumber: UmHymnsNumberSeeder.OMALA_139, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2187, content: "Iñila, iñila,\nVocunda cahe cohenda\nIñila, iñila,\nVocunda cahe cohenda.", hymnsNumber: UmHymnsNumberSeeder.OMALA_139, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2188, position: 2, content: "Eye okulia o tu lisa\nEye uwalo o tu luika,\nO tu iha viosi tua kamba.\nUngombo wetu wohenda.", hymnsNumber: UmHymnsNumberSeeder.OMALA_139, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2189, position: 3, content: "Ungombo wetu o popela\nNdaño tu ñuai, ndaño tu fa.\nO ka tu iñisa lesanju.\nVocunda cahe cokilu.", hymnsNumber: UmHymnsNumberSeeder.OMALA_139, typeStanza: HymnsContentCode.VERSE),
  ];
}